export const CustomIcon : React.FC<{ icon : string }> = ({ icon }) => {
    return (
        (() => {
            switch (icon) {
                case "html5":
                    return <i className="ri-html5-fill" />;
                case "css":
                    return <i className="ri-css3-fill" />;
                case "php":
                    return <div className="font-mono text-[1.25rem] skew-x-[-15deg]">php</div>;
                case "java":
                    return <Java />;
                case "laravel":
                    return <Laravel />;
                case "python":
                    return <Python />;
                case "sass-scss":
                    return <Sass />;
                case "flask":
                    return <Flask />;
                case "mysql":
                    return <div className="flex items-center justify-center font-serif text-[0.75rem]"><span className="text-[#00758F]">My</span><span className="text-[#F29111]">SQL</span></div>;
                case "javascript":
                    return <div className="flex items-center justify-center font-sans font-bold text-[1.5rem] text-black">JS</div>
                case "bootstrap":
                    return <i className="ri-bootstrap-line" />;
                case "firebase":
                    return <Firebase />;
                case "jquery":
                    return <JQuery />;
                case "go":
                    return <Go />;
                case "django":
                    return <div className="font-sans font-bold text-[1.5rem]">dj</div>;
                case "gcp":
                    return <GCP />;
                case "node-js":
                    return <NodeJS />;
                case "typescript":
                    return <div className="font-sans text-[1.5rem] text-[#FAFAFA] font-bold">TS</div>
                case "react":
                    return <i className="text-[#61DBFB] ri-reactjs-fill" />;
                case "vue-js": 
                    return <i className="ri-vuejs-line" />; // text-[#41B883]
                case "angular":
                    return <i className="ri-angularjs-line" />;
                case "git":
                    return <Git />;
                case "postgresql":
                    return <PostgreSQL />;
                case "mongodb":
                    return <MongoDB />;
                case "github":
                    return <i className="text-[2.5rem] text-[#FAFAFA] ri-github-fill" />;
                case "gitlab":
                    return <i className="text-[#FCA326] ri-gitlab-fill" />;
                case "graphql":
                    return <GraphQL />;
                case "docker":
                    return <Docker />;
                case "jenkins":
                    return <Jenkins />;
                case "ansible":
                    return <Ansible />;
                case "kubernetes":
                    return <Kubernetes />;
                default:
                    return <i className="ri-question-mark" />;
            }
        })()
    )
}

